import fetch from 'node-fetch'

export default function Projet({name}){
    return <h1>{name}</h1>
}

export async function getStaticPaths() {
    const data = await fetch("http://localhost/3000/api/projets")
    console.log(data)
    return{
        
        paths: [
            {
                params: {
                    projet: 'elite-down'
                }
            },
            {
                params: {
                    projet: 'fallen-forest'
                }
            }
        ],
        fallback: false
    }
}

export async function getStaticProps({params}) {
    return {
        props:{
            name: "Elite Down"
        }
    }
}
